COB（チップオンボード）LED採用で発光面が均一に輝く!!<br>
極薄 約4mmの車用高輝度パネル型LEDライト♪<br>
<br>
シンプル、故に多様な使い方。<br>
デイライト、ナンバープレートライト、ドアライト、ダウンライトなどなど。<br>
両面テープで貼り付けるだけの設置なので、自由自在です!!<br>
<br>
入り数：2本セット<br>
LEDカラー：ブルー、ホワイト<br>
サイズ：約 17×1.7×0.4cm<br>
ケーブル長さ：約 28cm<br>
対応電圧：12V<br>
生産国：中国<br>
<br>
