Bluetoothを搭載した携帯電話と、ワイヤレスで通話ができます。<BR>Bluetoothバージョン3.0仕様。iPhone5にも対応しています。<BR>（従来のバージョンとも互換性があり、従来のバージョンの携帯電話でも使用できます。）<BR><br><br>充電しながら待ち受け可能。<BR>マルチポイント機能搭載で同時に2台の携帯電話の待ち受け可能。<BR>車(12V/24V対応)でもパソコン（USB）でも充電ができるDC充電器+USB充電ケーブル付。<BR>ストラップ取付け可能。<BR>左右兼用で脱着可能な耳掛けフック付き。<BR><br><BR>■仕様<BR>無線方式：Bluetooth Ver.3.0<BR>無線距離：約10m以内<BR>電源供給：リチウムポリマー電池<BR>対応プロファイル：ハンズフリー(HFP)/ヘッドセット(HSP)<BR>連続使用時間：最大約7時間（待ち受け最大約160時間）<BR>充電時間：約2時間<BR>製品寸法：59W X 23H X 27D (mm)<BR>本体重量：12g（耳掛けフックを除く）<br><br>メーカー：カシムラ<br>品番：BL-23<br><BR><BR>■付属品<BR>DC充電器/USBケーブル/耳掛けフック<style type="text/css">
