スヌーピー(SNOOPY)のかわいいコードリール式スマートフォン充電器です。<br><br>セパレートタイプなので、合体させてお車のシガーソケットで充電！<br>USBソケットを外してお部屋のパソコンでも充電OK！<br><br><br>【特長】<br>●USB充電器は高出力1A仕様。<br>●USB充電器で他の機器も充電が可能。（DC5V/1A仕様）<br>●USBコードリールでパソコンから充電が可能。<br>●スムーズなコードの出し入れで、すっきり収まる巻き取り式。<br>●スマートフォン等に充電できるmicroUSB仕様。<br> ●DC12V/24V車兼用です。<br><br><br>【仕様】<br>カラー：ブルー<br>出力：1A<br>アダプタ：MicroUSB（スマートフォン用)<br>車載用電源：DC12/24V専用<br>USB電源：5V<br>通電：ブルーLED<br><br>メーカー：アークス<br>品番：SNA-17<style type="text/css">
